(128, 'Средняя общеобразовательная школа № 8 (МБОУ СОШ 8)', NULL, 1, 's_8.edu54.ru', 'Новосибирск', ' Курчатова', '37/1', '', 'Средняя общеобразовательная школа № 8 – открыта в 1982 году.\r\n20 лет руководил школой замечательный педагог, Отличник просвещения Василий Петрович Ильин. Им был создан дружный коллектив единомышленников, основными принципами которого стали уважение к личности ученика, доверие и требовательность, развитие и творчество.\r\nВ школе крепнут традиции высокого качества образования. Ученики школы занимаются исследовательской работой в научном обществе учащихся, ежегодно занимают призовые места в олимпиадах, интеллектуальных и творческих конкурсах, научно-практических конференциях от районного уровня до всероссийского.', 'N', 1, '2016-05-29 07:41:48'),
