(50, 'Лицей №130 им. академика М.А. Лаврентьева', 'o76fdeor4s.jpg', 1, 'licey130.ru', 'Новосибирск ', 'Ученых,10', '', '', 'Ефимова 2015 г: Сначала не хотели пускать, администрации не было в школе, уболтала охранника, отвел в учительскую, рассказала учителям кто я и зачем, сказали, что в классы нельзя. На переменах раздавала листовки всем, кого видела, по возможности рассказывала по сезонам и проектам, началку (5 классов) удалось обойти полноценно, листовки отдала учителям, выдадут в конце урока. учителям о ЗВД рассказала и родителям, которые попадались о сезонах и о том, как у нас хорошо. Объявление повесила на стенд, (там, кстати, Тимуровец, Чудолесье и еще какой-то языковой лагерь висели)\r\n\r\nБеркон в 2013 году приняли очень хорошо, но "сейчас эта школа уже не такая элитная как прежде". обошла 17 классов.: 1а, 1б, 1в, 2а, 2б, 2в, 3а, 3в, 5а, 5б, 7б, 7в, 8а, 8м, 9м, 9сп, 11сп.\r\n\r\nБелых в 2014г- в школу еще зайти можно, но только чтобы  разместить объявления и оставить часть листовок в учительской- по классам не пускают. раздала сколько получилось листовок в холле во время перемен... Увы. ЗАВуч нас не  жалует....\r\n22 апреля с утра обход\r\n2007-2010 плотно работали с Мариной Ойрутовной, каждое лето ездили не менее 70 детей, проводили для них праздник вожатским отрядом посвященный  самиздату в школе.Проседать начали с этой школой с 2013 года , сейчас ездят единицы.\r\n05.01.2015 позвонила маме Насти Жижиной, были у нас в прошлом году , нет решили не делать выпускной, так как на медиану (новый год) заказывали квест и очень понравилось всем', 'Y', 1, '2016-05-29 07:41:48'),
