(143, 'Лицей №113', 'r7fd0ckjbj.jpg', 1, 's_113.edu54.ru', 'Новосибирск', 'Бориса Богаткова', '241/1', '', 'Внешний вид раньше оставлял желать лучшего, сейчас там сменилась директриса - сменился и облик школы, и внутри стало все очень красиво и здорово. \r\nПед.состав - основной : все тот же. Плохо ни о ком сказать не могу. Единственное, если класс углубленно изучает гуманитарные науки, то естественные знания даются очень туго.. Так же,у всего класса,помнится были проблемы с историей. \r\nХочется сказать "спасибо": Земницкой Нине Михайловне за английский(она и помогла с определением профессии), Гуль Галине Ивановне за алгебру, Стаценко Нине Ивановне за географию и Полищук Ольге Владимировне за образование и дисциплину в начальной школе.', 'Y', 1, '2016-05-29 07:41:48'),
