(169, 'СОШ №102', 'pjsntqp2kv.jpg', 1, 'http://school-102.nios.ru/', 'Новосибирск', 'Экваторная', '5', '', 'Сегодня сто вторая для Нижней Ельцовки – это больше, чем просто место, куда дети приходят учиться: она давно приобрела статус центра социальной, культурной и спортивной жизни микрорайона. \r\n    Именно здесь проходит большая часть значимых мероприятий – от выборов всех уровней и встреч с первыми лицами до школьных концертов и фестивалей районного масштаба. Здесь располагается школа искусств № 21, которая регулярно организует отчетные концерты на радость детям и их родителям; часто устраиваются выставки репродукций классических и современных художников, проводятся научно-практические конференции школьников, с лекциями приходят сотрудники музеев Советского района. \r\n', 'Y', 1, '2016-05-29 07:41:48'),
