(244, 'Сибирский Кадетский Корпус', 'hf9y5wjguz.jpg', 1, 'http://www.scc-nsk.ru/', 'Новосибирск', 'Красногорская', '54', '', 'МБОУ КШИ «Сибирский Кадетский Корпус» – первый официально возрожденный в стране кадетский корпус, в основу деятельности которого заложены и старые отечественные традиции образования, и современные педагогические технологии. В 2009 году МБОУ КШИ «Сибирский Кадетский Корпус» и входящая в его состав «Академия благородных девиц» стали опорной школой города Новосибирска по гендерному образованию, соединяющему раздельное обучение и совместное воспитание юношей и девушек на основе нравственных ценностей жизни. Профессионализм и заслуги преподавательского состава и сотрудников СКК подтверждены наградами, почетными званиями и знаками отличия.', 'Y', 21, '2016-05-29 07:41:48'),
